  [],\n\t\"revision_timestamp\": \"2016-02-29T01:19:34.538376\",\n\t\"name\": \"ph-alkalinity-temperature-salinity-and-other-variables-collected-from-discrete-sample-and-profi93473\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0143391 includes discrete
  sample and profile data collected from GARCIA DEL CID in the Bay of Biscay and North
  Atlantic Ocean from 1986-09-04 to 1986-10-03 and retrieved during cruise CARINA/29GD19860904.
  These data include AMMONIUM (NH4), CHLOROPHYLL A, DISSOLVED OXYGEN, HYDROSTATIC
  PRESSURE, NITRATE, NITRITE, Potential temperature (theta), SALINITY, TOTAL ALKALINITY
  (TA), WATER TEMPERATURE, pH, phosphate and silicate. The instruments used to collect
  these data include CTD and bottle.nnThese data were collected by F. Perez of Commonwealth
  Scientific and Industrial Research Organization, Aida F. Rios of Instituto de Investigaciones
  Marinas de Vigo and F. Fraga [affiliation unknown] as part of the CARINA/29GD19860904
  data set.nnThe CARINA (CARbon dioxide IN the Atlantic Ocean) data synthesis project
  is an international collaborative effort of the EU IP CARBOOCEAN, and U.S. partners.
  It has produced a merged internally consistent data set of open ocean subsurface
  measurements for biogeochemical investigations, in particular, studies involving
  the carbon system. The original focus area was the North Atlantic Ocean, but over
  time the geographic extent expanded and CARINA now includes data from the entire
  Atlantic, the Arctic Ocean, and the Southern Ocean.\",\n\t\"license_title\": null,\n\t\"extras\":
